import React from 'react';

function Services() {
  return (
    <section className="services">
      <h2>Our Services</h2>
      <ul>
        <li>Property Valuation</li>
        <li>Project Feasibility</li>
        <li>Legal Documentation</li>
      </ul>
    </section>
  );
}

export default Services;
